import React, { useState } from "react";

import Container from "react-bootstrap/Container"
import Row from "react-bootstrap/Row"
import Col from "react-bootstrap/Col"

import ReactSearchBox from "react-search-box";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';


const ListPrinter = () => {

    const [printer, setPrinter] = useState([
        { model: 'HP - MFP M236SDW', id: '001', campuslocation: 'CS1', buildinglocation: 'C6202', status: 'Đang Đầy' },
        { model: 'HP - MFP M236SDW', id: '002', campuslocation: 'CS1', buildinglocation: 'C6202', status: 'Đang Đầy' },
        { model: 'HP - MFP M236SDW', id: '003', campuslocation: 'CS1', buildinglocation: 'C6202', status: 'Đang Đầy' },
    ]);

    // const handleEdit = (bookId) => {
    //     console.log(`Edit book with ID ${bookId}`);
    // };

    // const handleDelete = (bookId) => {
    //     console.log(`Delete book with ID ${bookId}`);
    // };
    return (

        <Container>
            <Row xs={12}>
                <Row style={{ marginTop: '30px' }}>
                    <strong style={{ textAlign: "left", fontSize: "20px", fontWeight: "500" }}>Trở lại</strong>
                </Row>
                <Row>
                    <Container>
                        <Row>
                            <strong style={{ textAlign: "left", fontSize: "40px", fontWeight: "700" }}>MÁY IN KHẢ DỤNG</strong>
                        </Row>
                        <Row style={{ width: "100%", marginTop: "15px" }}>
                            <Col style={{ width: "100%" }}>
                                <ReactSearchBox
                                    width="150%"
                                    placeholder="Search Here..."
                                />
                            </Col>
                            <Col style={{ display: "flex" }}>
                                <Button variant="outlined" color="primary" style={{ width: "80px", marginRight: "20px" }}>Search</Button>

                                <Button variant="outlined" color="secondary" style={{ width: "120px" }}>Thêm sách</Button>
                            </Col>
                        </Row>
                        <Row style={{ alignItems: 'center', width: "90%", marginTop: "30px" }}>
                            <TableContainer component={Paper} style={{ border: "3px solid grey" }}>
                                <Table>
                                    <TableHead>
                                        <TableRow>
                                            <TableCell>Model</TableCell>
                                            <TableCell>ID</TableCell>
                                            <TableCell>CƠ SỞ</TableCell>
                                            <TableCell>VỊ TRÍ</TableCell>
                                            <TableCell>TÌNH TRẠNG</TableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                        {printer.map((printer) => (
                                            <TableRow key={printer.id}>
                                                <TableCell>{printer.model}</TableCell>
                                                <TableCell>{printer.id}</TableCell>
                                                <TableCell>{printer.campuslocation}</TableCell>
                                                <TableCell>{printer.buildinglocation}</TableCell>
                                                <TableCell>{printer.status}</TableCell>
                                                <TableCell>
                                                    <Button variant="outlined" color="secondary" >Xóa</Button>
                                                </TableCell>
                                            </TableRow>
                                        ))}
                                    </TableBody>
                                </Table>
                            </TableContainer>
                        </Row>
                    </Container>

                </Row>

            </Row>
        </Container>
    )
};


export default ListPrinter;
